from collections import Counter


class Solution:
    def wordSubsets(self, A, B):
        c = Counter()
        for k, v in enumerate(B):
            temp = Counter(v)
            for c1, v1 in temp.items():
                if c.get(c1, 0) < v1:
                    c[c1] = v1
        ans = []
        for word in A:
            uni = True
            temp = Counter(word)
            for k, v in c.items():
                if v > temp.get(k, 0):
                    uni = False
                    break
            if uni: ans.append(word)

        return ans


